import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Route path="/" exact component= { PageOne } />
        <Route path="/pagetwo" exact component= { PageTwo } />
      </BrowserRouter>
    </div>
  );
}

export default App;
